INSERT INTO `content` VALUES (1,1,1,NULL,'2023-10-17 08:28:34','2023-10-21 16:37:24','a988d90b-7c9d-49c8-995f-63d07fedc575',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2,2,1,'Javascript Basisprincipes','2023-10-17 08:53:35','2023-10-21 11:20:46','7169e581-19ff-4383-ba81-f04007e3a0a2','<p>Leer <strong>JavaScript </strong>met deze complete cursus. Van beginner tot gevorderd.</p><p>Hands-on lesmethode.</p><p>JavaScript is een programmeertaal die vaak wordt gebruikt voor het maken van interactieve en dynamische webpagina\'s. Het is een geïnterpreteerde taal die in de webbrowser draait zonder dat er een aparte compiler nodig is. JavaScrpt ondersteunt objectgeoriënteerd programmeren, functies en callbacks, en kan HTML en CSS op een pagina manipuleren. Enkele basisconcepten in JavaScript omvatten variabelen, gegevenstypen, conditionals, loops en functies. JavaScript wordt vaak gebruikt in combinatie met HTML en CSS om dynamische en reactieve websites te maken. Het blijft een populaire en veelgebruikte scripttaal voor webontwikkeling.</p>',NULL,'afstandsleren',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(3,3,1,'Javascript basics','2023-10-17 08:53:52','2023-10-20 09:12:25','3cb39afe-6bfc-4ee3-ba86-8148983b475e',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(5,5,1,'Javascript Basics','2023-10-17 08:57:36','2023-10-20 09:12:25','20f72e23-80bf-4110-94f9-c8bdbdb1efff',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(7,7,1,'Javascript Basics','2023-10-17 08:58:42','2023-10-20 09:12:25','c1de48ff-f6f1-4a57-9315-563b07678e06','Learn JavaScript with this complete course. From beginner to advanced. Join millions of learners from around the world already learning.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(8,8,1,'PHP Basisprincipes','2023-10-17 09:14:58','2023-10-21 11:20:53','7e3e4a8e-7e2f-4eb8-b622-645699864632','<p>Leer de basisprincipes van <strong>PHP</strong>. Van beginner tot gemiddeld.</p><p>Hands-on lesmethode.</p><p>PHP is een populaire scripttaal aan de serverzijde die wordt gebruikt om dynamische webpagina\'s te maken. Het kan worden ingebed in HTML-code om webontwikkelaars meer controle te geven over de inhoud en functionaliteit van hun website. PHP kan een breed scala aan taken aan, van eenvoudige taken zoals het weergeven van de huidige datum tot complexere bewerkingen zoals interactie met databases en het verzenden van e-mailmeldingen. Enkele van de belangrijkste kenmerken van PHP zijn de flexibiliteit, snelheid en gebruiksgemak. Het is ook een open-sourcetaal met een grote gemeenschap van ontwikkelaars die bijdragen aan de voortdurende ontwikkeling en verbetering ervan.</p>',NULL,'afstandsleren',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(9,9,1,'PHP Basics','2023-10-17 09:15:40','2023-10-20 09:12:25','bc9d7294-fa0a-4e50-8f43-3202f5830219','Learn the basics of PHP. From beginner to intermediate. Hands on teaching.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(11,11,1,'Javascript Basics','2023-10-17 09:16:41','2023-10-20 09:12:25','18d73025-73a9-4b6b-ad48-1367875d3405','Learn JavaScript with this complete course. From beginner to advanced. \nJoin millions of learners from around the world already learning.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(13,13,1,'PHP Basics','2023-10-17 09:16:51','2023-10-20 09:12:25','28994c4d-e6c0-4196-95b8-c46a0337d18a','Learn the basics of PHP. From beginner to intermediate. \nHands on teaching.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(15,15,1,'PHP Basics','2023-10-17 09:23:23','2023-10-20 09:12:25','a30a5238-56ff-4160-af0f-de84e5c58957','<p>Learn the basics of <strong>PHP</strong>. From beginner to intermediate. </p>\n<p>Hands on teaching.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(17,17,1,'Javascript Basics','2023-10-17 09:23:39','2023-10-20 09:12:25','e1499fb5-6bab-46b8-9d5c-00d9e78ed94e','<p>Learn <strong>JavaScript </strong>with this complete course. From <em>beginne