esmethode.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(102,102,1,'Javascript Basisprincipes','2023-10-20 13:05:12','2023-10-20 13:05:12','a15464b4-db03-4aba-a801-ad25e1018e76','<p>Leer <strong>JavaScript </strong>met deze complete cursus. Van beginner tot gevorderd.</p>\n<p>Hands-on lesmethode.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(104,104,1,'Javascript Basisprincipes','2023-10-21 08:56:37','2023-10-21 08:56:37','424e701e-0045-4be8-a763-e5db000e3b55','<p>Leer <strong>JavaScript </strong>met deze complete cursus. Van beginner tot gevorderd.</p><p>Hands-on lesmethode.</p><p>JavaScript is een programmeertaal die vaak wordt gebruikt voor het maken van interactieve en dynamische webpagina\'s. Het is een geïnterpreteerde taal die in de webbrowser draait zonder dat er een aparte compiler nodig is. JavaScrpt ondersteunt objectgeoriënteerd programmeren, functies en callbacks, en kan HTML en CSS op een pagina manipuleren. Enkele basisconcepten in JavaScript omvatten variabelen, gegevenstypen, conditionals, loops en functies. JavaScript wordt vaak gebruikt in combinatie met HTML en CSS om dynamische en reactieve websites te maken. Het blijft een populaire en veelgebruikte scripttaal voor webontwikkeling.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(106,106,1,'Javascript Basisprincipes','2023-10-21 08:58:46','2023-10-21 08:58:46','19afaf45-16ca-4cb9-92e6-50435518aee9','<p>Leer <strong>JavaScript </strong>met deze complete cursus. Van beginner tot gevorderd.</p><p>Hands-on lesmethode.</p><p>JavaScript is een programmeertaal die vaak wordt gebruikt voor het maken van interactieve en dynamische webpagina\'s. Het is een geïnterpreteerde taal die in de webbrowser draait zonder dat er een aparte compiler nodig is. JavaScrpt ondersteunt objectgeoriënteerd programmeren, functies en callbacks, en kan HTML en CSS op een pagina manipuleren. Enkele basisconcepten in JavaScript omvatten variabelen, gegevenstypen, conditionals, loops en 