rsprong tot heden, inclusief hun fysieke kenmerken, evolutie en gedrag. Biologische antropologie onderzoekt ook de interactie tussen de menselijke biologie en cultuur, en hoe deze twee factoren de menselijke sociale en culturele diversiteit hebben gevormd. Onderzoekers op dit gebied gebruiken verschillende methoden om onderwerpen als menselijke genetica, voortplanting, groei en ontwikkeling, en ziekte te onderzoeken.</p>',NULL,'contactonderwijs','2023-09-17 22:00:00','2023-11-16 23:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(145,145,1,'Antropologie','2023-10-21 15:55:18','2023-10-21 15:55:18','367fef05-c7a8-4f76-bce2-aadad294496e',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(146,146,1,'Biologische antropologie','2023-10-21 15:55:21','2023-10-21 15:55:21','2c5ca8cd-4ce2-4d1a-b313-9b0e29753c8d','<p>Biologische antropologie is een tak van de antropologie die zich richt op de studie van de menselijke biologie, fysiologie en genetica. Het onderzoekt de evolutie en variatie van mensen vanaf hun vroegste oorsprong tot heden, inclusief hun fysieke kenmerken, evolutie en gedrag. Biologische antropologie onderzoekt ook de interactie tussen de menselijke biologie en cultuur, en hoe deze twee factoren de menselijke sociale en culturele diversiteit hebben gevormd. Onderzoekers op dit gebied gebruiken verschillende methoden om onderwerpen als menselijke genetica, voortplanting, groei en ontwikkeling, en ziekte te onderzoeken.</p>',NULL,'contactonderwijs','2023-09-17 22:00:00','2023-11-16 23:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(147,147,1,'Taalkundige antropologie','2023-10-21 15:55:41','2023-10-21 16:00:27','c7494bc0-8d61-454d-ac39-ec6414c35bdc','<p>Taalkundige antropologie is een deelgebied van de antropologie dat de rol van taal in de menselijke cultuur en samenleving bestudeert. Taalkundige antropologen onderzoeken de complexe relaties tussen taal, cultuur en sociale structuur en onderzoeken hoe taal de overtuigingen, waarden en gedragingen van verschillende groepen weerspiegelt en vormgeeft. Ze onderzoeken ook patronen van taalgebruik en variatie tussen culturen en omstandigheden, en de manieren waarop taal wordt gebruikt om sociale identiteiten en relaties te construeren. Taalkundige antropologie omvat een breed scala aan onderwerpen, van de studie van dialecten en taalverandering tot taalverwerving en tweetaligheid.</p>',NULL,'contactonderwijs','2023-09-17 22:00:00','2023-11-16 23:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(148,148,1,'Taalkundige antropologie','2023-10-21 15:59:08','2023-10-21 15:59:08','48fac3b9-4ec6-4c56-84da-6f1a08c4b8a0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(149,149,1,'Taalkundige antropologie','2023-10-21 15:59:10','2023-10-21 15:59:10','c62a16a4-6011-4d66-9468-c76b681a0525','<p>Taalkundige antropologie is een deelgebied van de antropologie dat de rol van taal in de menselijke cultuur en samenleving bestudeert. Taalkundige antropologen onderzoeken de complexe relaties tussen taal, cultuur en sociale structuur en onderzoeken hoe taal de overtuigingen, waarden en gedragingen van verschillende groepen weerspiegelt en vormgeeft. Ze onderzoeken ook patronen van taalgebruik en variatie tussen culturen en omstandigheden, en de manieren waarop taal wordt gebruikt om sociale identiteiten en relaties te construeren. Taalkundige antropologie omvat een breed scala aan onderwerpen, van de studie van dialecten en taalverandering tot taalverwerving en tweetaligheid.</p>',NULL,'contactonderwijs','2023-09-17 22:00:00','2023-11-16 23:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(151,151,1,'Taalkundige antropologie','2023-10-21 16:00:20','2023-10-21 16:00:21','8b072a87-9316-42c9-9d7d-d6f95f0c0a0e',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(152,152,1,'Taalkundige antropologie','2023-10-21 16:00:27','2023-10-21 16:00:27','6a2b2ab5-bceb-4de5-b711-b6b3dc7ed704','<p>Taalkundige antropologie is een deelgebied van de antropologie dat de rol van taal in de menselijke cultuur en samenleving bestudeert. Taalkundige antropologen onderzoeken de complexe relaties tussen taal, cultuur en sociale structuur en onderzoeken hoe taal de overtuigingen, waarden en gedragingen van verschillende groepen weerspiegelt en vormgeeft. Ze onderzoeken ook patronen van taalgebruik en variatie tussen culturen en omstandigheden, en de manieren waarop taal wordt gebruikt om sociale identiteiten en relaties te construeren. Taalkundige antropologie omvat een breed scala aan onderwerpen, van de studie van dialecten en taalverandering tot taalverwerving en tweetaligheid.</p>',NULL,'contactonderwijs','2023-09-17 22:00:00','2023-11-16 23:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(153,153,1,'Culturele antropologie','2023-10-21 16:01:26','2023-10-21 16:06:40','c37453a3-af49-4cba-ac1c-33e0e1cbb52f','<p>Culturele antropologie is een tak van de antropologie die de culturele overtuigingen, praktijken, gedragingen en artefacten van menselijke samenlevingen onderzoekt. Dit vakgebied richt zich op het begrijpen van de manieren waarop verschillende samenlevingen opereren, hoe ze met elkaar omgaan en hoe ze zich in de loop van de tijd aanpassen aan veranderingen. Culturele antropologen maken gebruik van een verscheidenheid aan onderzoeksmethoden, waaronder participerende observatie, etnografie en interculturele vergelijking, om inzicht te krijgen in de diverse manieren waarop mensen met verschillende culturele achtergronden de wereld om hen heen ervaren.</p>',NULL,'contactonderwijs','2023-09-17 22:00:00','2023-11-16 23:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(154,154,1,'Culturele antropologie','2023-10-21 16:06:38','2023-10-21 16:06:38','9fc06cf4-7b66-44a8-81af-006c3215c756',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(155,155,1,'Culturele antropologie','2023-10-21 16:06:40','2023-10-21 16:06:40','cb9fe34a-c7d8-4a69-88f5-004442fc99c0','<p>Culturele antropologie is een tak van de antropologie die de culturele overtuigingen, praktijken, gedragingen en artefacten van menselijke samenlevingen onderzoekt. Dit vakgebied richt zich op het begrijpen van de manieren waarop verschillende samenlevingen opereren, hoe ze met elkaar omgaan en hoe ze zich in de loop van de tijd aanpassen aan veranderingen. Culturele antropologen maken gebruik van een verscheidenheid aan onderzoeksmethoden, waaronder participerende observatie, etnografie en interculturele vergelijking, om inzicht te krijgen in de diverse manieren waarop mensen met verschillende culturele achtergronden de wereld om hen heen ervaren.</p>',NULL,'contactonderwijs','2023-09-17 22:00:00','2023-11-16 23:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(156,156,1,'Anatomie','2023-10-21 16:16:24','2023-10-21 16:21:32','bd3cef08-7dce-4284-9e19-5887bdc49d21','<p>Biologie is de wetenschappelijke studie van levende organismen en hun interacties met de omgeving. Het omvat een breed scala aan gebieden, waaronder biochemie, genetica, ecologie en evolutie. Biologen bestuderen alles, van de kleinste cellen tot hele ecosystemen, en proberen de processen te begrijpen die het leven op aarde beheersen. Door hun onderzoek proberen biologen fundamentele vragen te beantwoorden over de oorsprong en diversiteit van het leven, de mechanismen van overerving en genetische variatie, en de rol van individuen en hun samenlevingen binnen grotere ecologische gemeenschappen. Hun bevindingen hebben belangrijke implicaties voor de geneeskunde, de landbouw, natuurbehoud en ons begrip van onze plaats in de natuurlijke wereld.</p>',NULL,'contactonderwijs','2023-10-08 22:00:00','2024-01-29 23:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(157,157,1,'Biologie','2023-10-21 16:21:29','2023-10-21 16:21:29','3b551161-67f7-4f53-acc0-788174e3991c',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(158,158,1,'Anatomie','2023-10-21 16:21:32','2023-10-21 16:21:32','4da8f3a7-d685-4fbc-bcc4-ba2031017f43','<p>Biologie is de wetenschappelijke studie van levende organismen en hun interacties met de omgeving. Het omvat een breed scala aan gebieden, waaronder biochemie, genetica, ecologie en evolutie. Biologen bestuderen alles, van de kleinste cellen tot hele ecosystemen, en proberen de processen te begrijpen die het leven op aarde beheersen. Door hun onderzoek proberen biologen fundamentele vragen te beantwoorden over de oorsprong en diversiteit van het leven, de mechanismen van overerving en genetische variatie, en de rol van individuen en hun samenlevingen binnen grotere ecologische gemeenschappen. Hun bevindingen hebben belangrijke implicaties voor de geneeskunde, de landbouw, natuurbehoud en ons begrip van onze plaats in de natuurlijke wereld.</p>',NULL,'contactonderwijs','2023-10-08 22:00:00','2024-01-29 23:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(159,159,1,'Fysiologie','2023-10-21 16:21:41','2023-10-21 16:32:46','ffbf0310-bb6f-4ad4-9900-64d97bb2a755','<p>Fysiologie is de wetenschappelijke studie van de functies en processen van levende organismen. Het omvat de studie van hoe cellen, weefsels, organen en systemen samenwerken om de homeostase te behouden en overleving te garanderen. Belangrijke studiegebieden binnen de fysiologie zijn onder meer het zenuwstelsel, het cardiovasculaire systeem, het ademhalingssysteem, het spijsverteringsstelsel en het endocriene systeem. Door de onderliggende mechanismen en processen van deze lichaamssystemen te onderzoeken, proberen fysiologen te begrijpen hoe ze de interne omgeving van het lichaam reguleren, reageren op externe stimuli en zich in de loop van de tijd aanpassen aan veranderingen in hun omgeving. Het begrijpen van deze processen is van cruciaal belang voor het ontwikkelen van effectieve behandelingen voor een reeks gezondheidsproblemen.</p>',NULL,'contactonderwijs','2023-10-08 22:00:00','2024-01-29 23:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(160,160,1,'Fysiologie','2023-10-21 16:32:42','2023-10-21 16:32:43','d04d806c-78db-4183-996e-63954e394ee1',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(161,161,1,'Fysiologie','2023-10-21 16:32:46','2023-10-21 16:32:46','2592f5a8-2091-421d-a7de-9c905783056b','<p>Fysiologie is de wetenschappelijke studie van de functies en processen van levende organismen. Het omvat de studie van hoe cellen, weefsels, organen en systemen samenwerken om de homeostase te behouden en overleving te garanderen. Belangrijke studiegebieden binnen de fysiologie zijn onder meer het zenuwstelsel, het cardiovasculaire systeem, het ademhalingssysteem, het spijsverteringsstelsel en het endocriene systeem. Door de onderliggende mechanismen en processen van deze lichaamssystemen te onderzoeken, proberen fysiologen te begrijpen hoe ze de interne omgeving van het lichaam reguleren, reageren op externe stimuli en zich in de loop van de tijd aanpassen aan veranderingen in hun omgeving. Het begrijpen van deze processen is van cruciaal belang voor het ontwikkelen van effectieve behandelingen voor een reeks gezondheidsproblemen.</p>',NULL,'contactonderwijs','2023-10-08 22:00:00','2024-01-29 23:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(162,162,1,'Pathologie','2023-10-21 16:33:54','2023-10-21 16:36:08','25d7e3eb-2561-42e0-a1cb-b1406b4bc254','<p>Pathologie is de studie van ziekten en de oorzaken, processen en effecten ervan op het lichaam. Het omvat het onderzoek van weefsels, cellen, organen en lichaamsvloeistoffen om ziekten te diagnosticeren en hun onderliggende mechanismen te identificeren. Pathologen gebruiken verschillende technieken zoals weefselkleuring, microscopie en genetische tests om abnormale cellen te identificeren, de ernst van een ziekte te bepalen en behandelplannen te ontwikkelen. Ze werken nauw samen met andere beroepsbeoefenaren in de gezondheidszorg om een nauwkeurige diagnose te stellen en ervoor te zorgen dat patiënten de best mogelijke zorg krijgen. Pathologie is essentieel voor het begrijpen van ziekten, het identificeren van risicofactoren en het ontwikkelen van nieuwe therapieën.</p>',NULL,'contactonderwijs','2023-10-08 22:00:00','2024-01-29 23:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(163,163,1,'Pathologie','2023-10-21 16:36:06','2023-10-21 16:36:06','6b1a5507-4b7d-4cc0-9688-d502309fed5a',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(164,164,1,'Pathologie','2023-10-21 16:36:08','2023-10-21 16:36:08','3baa7366-db0a-4fb0-9282-1cf6884a36d9','<p>Pathologie is de studie van ziekten en de oorzaken, processen en effecten ervan op het lichaam. Het omvat het onderzoek van weefsels, cellen, organen en lichaamsvloeistoffen om ziekten te diagnosticeren en hun onderliggende mechanismen te identificeren. Pathologen gebruiken verschillende technieken zoals weefselkleuring, microscopie en genetische tests om abnormale cellen te identificeren, de ernst van een ziekte te bepalen en behandelplannen te ontwikkelen. Ze werken nauw samen met andere beroepsbeoefenaren in de gezondheidszorg om een nauwkeurige diagnose te stellen en ervoor te zorgen dat patiënten de best mogelijke zorg krijgen. Pathologie is essentieel voor het begrijpen van ziekten, het identificeren van risicofactoren en het ontwikkelen van nieuwe therapieën.</p>',NULL,'contactonderwijs','2023-10-08 22:00:00','2024-01-29 23:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(165,165,1,'Virologie','2023-10-21 16:39:27','2023-10-21 16:42:38','e88ea861-fb72-4b6a-aac2-bdb1a93178af','<p>Virologie is de studie van virussen en hun interacties met gastheren, waaronder mensen, dieren en planten. Het omvat een breed scala aan onderwerpen, van de structuur en replicatie van virussen tot hun rol bij uitbraken van ziekten en pandemische bedreigingen. Virologen gebruiken verschillende technieken, zoals microscopie, genetische manipulatie en immunologie, om virale infecties te onderzoeken en behandelingen en vaccins te ontwikkelen. Ze werken ook nauw samen met volksgezondheidsfunctionarissen om de verspreiding van virusziekten, zoals HIV/AIDS, griep en COVID-19, te monitoren en te beheersen. Over het geheel genomen speelt virologie een cruciale rol bij het begrijpen en verzachten van de impact van virale pathogenen op de menselijke gezondheid en de mondiale samenleving.</p>',NULL,'contactonderwijs','2023-10-08 22:00:00','2023-11-29 23:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(166,166,1,'Virologie','2023-10-21 16:42:34','2023-10-21 16:42:35','a76e5015-781c-437b-b493-df45871d7047',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(167,167,1,'Virologie','2023-10-21 16:42:38','2023-10-21 16:42:38','da69aebe-a054-459a-b083-f0b03dfc7646','<p>Virologie is de studie van virussen en hun interacties met gastheren, waaronder mensen, dieren en planten. Het omvat een breed scala aan onderwerpen, van de structuur en replicatie van virussen tot hun rol bij uitbraken van ziekten en pandemische bedreigingen. Virologen gebruiken verschillende technieken, zoals microscopie, genetische manipulatie en immunologie, om virale infecties te onderzoeken en behandelingen en vaccins te ontwikkelen. Ze werken ook nauw samen met volksgezondheidsfunctionarissen om de verspreiding van virusziekten, zoals HIV/AIDS, griep en COVID-19, te monitoren en te beheersen. Over het geheel genomen speelt virologie een cruciale rol bij het begrijpen en verzachten van de impact van virale pathogenen op de menselijke gezondheid en de mondiale samenleving.</p>',NULL,'contactonderwijs','2023-10-08 22:00:00','2023-11-29 23:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(168,168,1,'Toegepaste economie','2023-10-21 17:05:11','2023-10-21 17:07:42','9e672c31-bdab-4b61-9df3-7d3183c3cee1','<p>Toegepaste economie is de studie van hoe economische theorieën, principes en concepten praktisch kunnen worden gebruikt in praktijksituaties. Het omvat de toepassing van economische analyse op verschillende gebieden, zoals financiën, zaken, gezondheidszorg, onderwijs en openbaar beleid. Het doel van toegepaste economie is om besluitvormers inzicht te geven in de waarschijnlijke uitkomsten van verschillende economische beleidsmaatregelen en acties, en hen te helpen weloverwogen beslissingen te nemen op basis van bewijsmateriaal en analyse. Toegepaste economen gebruiken een verscheidenheid aan hulpmiddelen en technieken, zoals statistische analyse, computermodellering en simulaties, om hun onderzoek uit te voeren en aanbevelingen te doen.</p>',NULL,'afstandsleren','2023-10-08 22:00:00','2024-01-29 23:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(169,169,1,'Toegepaste economie','2023-10-21 17:07:41','2023-10-21 17:07:41','acc84e76-6fd3-4d8b-9978-0b1fac19cead',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(170,170,1,'Toegepaste economie','2023-10-21 17:07:43','2023-10-21 17:07:43','c45ef48c-9480-4061-ad42-e5a33f4d03de','<p>Toegepaste economie is de studie van hoe economische theorieën, principes en concepten praktisch kunnen worden gebruikt in praktijksituaties. Het omvat de toepassing van economische analyse op verschillende gebieden, zoals financiën, zaken, gezondheidszorg, onderwijs en openbaar beleid. Het doel van toegepaste economie is om besluitvormers inzicht te geven in de waarschijnlijke uitkomsten van verschillende economische beleidsmaatregelen en acties, en hen te helpen weloverwogen beslissingen te nemen op basis van bewijsmateriaal en analyse. Toegepaste economen gebruiken een verscheidenheid aan hulpmiddelen en technieken, zoals statistische analyse, computermodellering en simulaties, om hun onderzoek uit te voeren en aanbevelingen te doen.</p>',NULL,'afstandsleren','2023-10-08 22:00:00','2024-01-29 23:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(171,171,1,'Agrarische economie','2023-10-21 17:08:01','2023-10-21 17:12:43','19efb8b6-0553-4bd6-b7b2-66f1fd4a89c4','<p>Agrarische economie is de studie van economische principes die worden toegepast op landbouwpraktijken, productie, management en marketing. Het omvat het onderzoeken van de kosten en baten van verschillende landbouwbeslissingen, evenals het analyseren van factoren die de vraag naar en het aanbod van landbouwproducten op lokale, nationale en mondiale markten beïnvloeden. Landbouweconomen onderzoeken ook kwesties die verband houden met landgebruik, ecologische duurzaamheid, handelsbeleid en overheidsregelgeving. Het uiteindelijke doel van de landbouweconomie is het verbeteren van de economische prestaties, efficiëntie en duurzaamheid van landbouwsystemen en tegelijkertijd tegemoetkomen aan de behoeften van producenten, consumenten en de samenleving als geheel.</p>',NULL,'afstandsleren','2023-10-08 22:00:00','2024-01-29 23:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(172,172,1,'Agrarische economie','2023-10-21 17:12:27','2023-10-21 17:12:27','bd759e86-3536-44ce-877c-f29b683abdf5',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(173,173,1,'Agrarische economie','2023-10-21 17:12:43','2023-10-21 17:12:43','15092dc5-ff64-4fb4-89e4-9705c525b45d','<p>Agrarische economie is de studie van economische principes die worden toegepast op landbouwpraktijken, productie, management en marketing. Het omvat het onderzoeken van de kosten en baten van verschillende landbouwbeslissingen, evenals het analyseren van factoren die de vraag naar en het aanbod van landbouwproducten op lokale, nationale en mondiale markten beïnvloeden. Landbouweconomen onderzoeken ook kwesties die verband houden met landgebruik, ecologische duurzaamheid, handelsbeleid en overheidsregelgeving. Het uiteindelijke doel van de landbouweconomie is het verbeteren van de economische prestaties, efficiëntie en duurzaamheid van landbouwsystemen en tegelijkertijd tegemoetkomen aan de behoeften van producenten, consumenten en de samenleving als geheel.</p>',NULL,'afstandsleren','2023-10-08 22:00:00','2024-01-29 23:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(174,174,1,'Hedendaagse filosofie','2023-10-21 17:12:56','2023-10-21 17:16:24','09678eb8-25a6-45df-b670-38d37af42962','<p>Hedendaagse filosofie verwijst naar de studie van de aard van de werkelijkheid en het bestaan, de betekenis en het doel van het leven, en de rol van mensen in de samenleving in de moderne wereld. Het omvat een breed scala aan onderwerpen, van ethiek en moraliteit tot politiek, epistemologie en metafysica. Hedendaagse filosofen gebruiken verschillende methoden, waaronder kritische analyse en argumentatie, om deze concepten te onderzoeken en nieuwe theorieën en ideeën te ontwikkelen. Het veld van de hedendaagse filosofie evolueert voortdurend naarmate er nieuwe kwesties ontstaan, en het blijft een belangrijk studiegebied voor diegenen die geïnteresseerd zijn in het begrijpen van de complexiteit van de wereld waarin we leven.</p>',NULL,'contactonderwijs','2023-11-12 23:00:00','2024-03-28 23:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(175,175,1,'Hedendaagse filosofie','2023-10-21 17:16:22','2023-10-21 17:16:22','e1e26684-4831-4a01-8724-e7b56c307bac',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(176,176,1,'Hedendaagse filosofie','2023-10-21 17:16:24','2023-10-21 17:16:24','f0091b7e-fdfd-40dc-b1b1-0a5b47286361','<p>Hedendaagse filosofie verwijst naar de studie van de aard van de werkelijkheid en het bestaan, de betekenis en het doel van het leven, en de rol van mensen in de samenleving in de moderne wereld. Het omvat een breed scala aan onderwerpen, van ethiek en moraliteit tot politiek, epistemologie en metafysica. Hedendaagse filosofen gebruiken verschillende methoden, waaronder kritische analyse en argumentatie, om deze concepten te onderzoeken en nieuwe theorieën en ideeën te ontwikkelen. Het veld van de hedendaagse filosofie evolueert voortdurend naarmate er nieuwe kwesties ontstaan, en het blijft een belangrijk studiegebied voor diegenen die geïnteresseerd zijn in het begrijpen van de complexiteit van de wereld waarin we leven.</p>',NULL,'contactonderwijs','2023-11-12 23:00:00','2024-03-28 23:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(177,177,1,'Middeleeuwse filosofie','2023-10-21 17:16:46','2023-10-21 17:19:05','222a7041-e331-42ff-8fad-46e529465614','<p>Middeleeuwse filosofie verwijst naar het filosofische denken dat zich in West-Europa ontwikkelde tijdens de middeleeuwen, grofweg van de 5e tot de 15e eeuw. Het werd sterk beïnvloed door de werken van Aristoteles en Plato, maar ook door de christelijke theologie. Sleutelfiguren zijn onder meer Augustinus van Hippo, Thomas van Aquino en Willem van Ockham. Middeleeuwse filosofen onderzochten onderwerpen als de aard van God, het bestaan van de vrije wil en de relatie tussen geloof en rede. De erfenis van de middeleeuwse filosofie is terug te zien in de ontwikkeling van de moderne filosofie en wetenschap.</p>',NULL,'contactonderwijs','2023-11-12 23:00:00','2024-03-21 23:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(178,178,1,'Middeleeuwse filosofie','2023-10-21 17:19:03','2023-10-21 17:19:03','64184d03-4cf9-4ad7-ad3d-d25ee7fcac91',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(179,179,1,'Middeleeuwse filosofie','2023-10-21 17:19:05','2023-10-21 17:19:05','ee28a1ad-acec-4806-a0f4-d43d2c55ff0d','<p>Middeleeuwse filosofie verwijst naar het filosofische denken dat zich in West-Europa ontwikkelde tijdens de middeleeuwen, grofweg van de 5e tot de 15e eeuw. Het werd sterk beïnvloed door de werken van Aristoteles en Plato, maar ook door de christelijke theologie. Sleutelfiguren zijn onder meer Augustinus van Hippo, Thomas van Aquino en Willem van Ockham. Middeleeuwse filosofen onderzochten onderwerpen als de aard van God, het bestaan van de vrije wil en de relatie tussen geloof en rede. De erfenis van de middeleeuwse filosofie is terug te zien in de ontwikkeling van de moderne filosofie en wetenschap.</p>',NULL,'contactonderwijs','2023-11-12 23:00:00','2024-03-21 23:00:00',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(180,180,1,'Cursussen overzichtspagina','2023-10-22 07:42:14','2023-10-22 07:42:14','446c605c-008b-4a39-9cfa-6c65a0fcea26',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(181,181,1,'Cursussen overzichtspagina','2023-10-22 07:42:14','2023-10-22 07:42:14','e15e2084-b8c2-4533-ad26-493294a242ff',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL