ULL),(198,198,1,'Malcolm X','2023-10-22 08:17:14','2023-10-22 14:18:55','68848147-3308-43fa-b64b-8838d878d6f2',NULL,NULL,NULL,NULL,NULL,'Onderwijs is het paspoort voor de toekomst, \nwant morgen behoort aan diegene die zich er vandaag op voorbereidt','Malcolm X',NULL,NULL,NULL,NULL,NULL),(199,199,1,'Immunologie','2023-10-22 08:47:26','2023-10-22 08:50:14','f70ea4c7-6da1-4ffc-93aa-8fdcddd096ee','<p>Immunologie is een tak van de biomedische wetenschap die zich bezighoudt met de studie van het immuunsysteem. Het behandelt onderwerpen die verband houden met de afweermechanismen van het lichaam tegen infectieuze agentia, en ook hoe het immuunsysteem helpt bij de diagnose en behandeling van ziekten. Immunologie richt zich ook op de studie van de structuur en functie van immuuncellen, moleculen en organen. Het veld speelt een sleutelrol in de ontwikkeling van vaccins, immuuntherapieën en diagnostiek. Het begrijpen van de principes van de immunologie is van cruciaal belang bij het beschermen van de menselijke gezondheid en het ontwikkelen van strategieën om infectieziekten en auto-immuunziekten te bestrijden.</p>',NULL,'afstandsleren',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(200,200,1,'Immunologie','2023-10-22 08:50:12','2023-10-22 08:50:12','cd1c4d85-17ad-461c-b5ec-f8b03a1e3923',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(201,201,1,'Immunologie','2023-10-22 08:50:14','2023-10-22 08:50:14','d618b1e1-bcc0-4f66-90c2-ec5dc00b7277','<p>Immunologie is een tak van de biomedische wetenschap die zich bezighoudt met de studie van het immuunsysteem. Het behandelt onderwerpen die verband houden met de afweermechanismen van het lichaam tegen infectieuze agentia, en ook hoe het immuunsysteem helpt bij de diagnose en behandeling van ziekten. Immunologie richt zich ook op de studie van de structuur en functie van immuuncellen, moleculen en organen. Het veld speelt een sleutelrol in de ontwikkeling van vaccins, immuuntherapieën en diagnostiek. Het begrijpen van de principes van de immunologie is van cruciaal belang bij het beschermen van de menselijke gezondheid en het ontwikkelen van strategieën om infectieziekten en auto-immuunziekten te bestrijden.</p>',NULL,'afstandsleren',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(202,202,1,'Algoritmen','2023-10-22 08:52:23','2023-10-22 08:53:36','bdc56f75-24d1-40c3-bc06-87c2fad1ec4a','<p>Algoritmen zijn stapsgewijze procedures die de aanpak voor het oplossen van een probleem schetsen. Ze worden vaak gebruikt in de informatica en programmeren om efficiënte en effectieve programma\'s te maken. Een algoritme kan worden gezien als een recept dat instructies geeft over hoe een taak moet worden uitgevoerd. Algoritmen omvatten vaak het gebruik van controlestructuren zoals lussen en conditionals om ervoor te zorgen dat het proces consistente en nauwkeurige resultaten oplevert. Ze zijn essentieel op veel technologische gebieden, waaronder kunstmatige intelligentie, machinaal leren en datawetenschap. Goed ontworpen algoritmen kunnen de efficiëntie verbeteren en innovatie in een breed scala van industrieën stimuleren.</p>',NULL,'afstandsleren',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(203,203,1,'Algoritmen','2023-10-22 08:53:33','2023-10-22 08:53:33','fd0faf65-2f32-4d2d-9755-975d3ea98615',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(204,204,1,'Algoritmen','2023-10-22 08:53:36','2023-10-22 08:53:36','b166762d-0478-4dfc-83e3-e0d77841537d','<p>Algoritmen zijn stapsgewijze procedures die de aanpak voor het oplossen van een probleem schetsen. Ze worden vaak gebruikt in de informatica en programmeren om efficiënte en effectieve programma\'s te maken. Een algoritme kan worden gezien als een recept dat instructies geeft over hoe een taak moet worden uitgevoerd. Algoritmen omvatten vaak het gebruik van controlestructuren zoals lussen en conditionals om ervoor te zorgen dat het proces consistente en nauwkeurige resultaten oplevert. Ze zijn essentieel op veel technologische gebieden, waaronder kunstmatige intelligentie, machinaal leren en datawetenschap. Goed ontworpen algoritmen kunnen de efficiëntie verbeteren en innovatie in een breed scala van industrieën stimuleren.</p>',NULL,'afstandsleren',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(205,205,1,'Cloud computing','2023-10-22 08:55:18','2023-10-22 08:58:30','3294b0d2-3d70-4781-b6cd-7894501ad6d3','<p>Cloud computing verwijst naar de levering van computerdiensten, waaronder servers, opslag, applicaties en gegevens, via internet. Met cloud computing kunnen gebruikers vrijwel overal toegang krijgen tot bronnen en deze gebruiken, met behulp van verschillende apparaten. Cloudservices worden doorgaans geleverd door externe leveranciers, die zich mogelijk specialiseren in het leveren van specifieke services, zoals infrastructuur as a service (IaaS), software as a service (SaaS) of platform as a service (PaaS). Cloud computing is over het algemeen kosteneffectiever en flexibeler dan traditionele oplossingen op locatie, waardoor het populair is bij bedrijven van elke omvang.</p>',NULL,'afstandsleren',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(206,206,1,'Cloud computing','2023-10-22 08:58:18','2023-10-22 08:58:19','c31f4156-06cf-4412-8529-712b38bf65f3',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(207,207,1,'Cloud computing','2023-10-22 08:58:30','2023-10-22 08:58:30','e5cb14f4-9e0e-499a-8c49-c87b73301e78','<p>Cloud computing verwijst naar de levering van computerdiensten, waaronder servers, opslag, applicaties en gegevens, via internet. Met cloud computing kunnen gebruikers vrijwel overal toegang krijgen tot bronnen en deze gebruiken, met behulp van verschillende apparaten. Cloudservices worden doorgaans geleverd door externe leveranciers, die zich mogelijk specialiseren in het leveren van specifieke services, zoals infrastructuur as a service (IaaS), software as a service (SaaS) of platform as a service (PaaS). Cloud computing is over het algemeen kosteneffectiever en flexibeler dan traditionele oplossingen op locatie, waardoor het populair is bij bedrijven van elke omvang.</p>',NULL,'afstandsleren',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(208,208,1,'Europese geschiedenis','2023-10-22 08:58:44','2023-10-22 09:00:07','72568bcd-39d2-4ea4-abeb-cd8d41b22654','<p>Europa heeft een rijke en gevarieerde geschiedenis die teruggaat tot de prehistorie. Van de megalithische tempels op Malta en de Keltische nederzettingen in Ierland tot de klassieke oudheid van Griekenland en Rome, en de middeleeuwen met kastelen en kruistochten. Europa heeft ook belangrijke bijdragen geleverd aan de wetenschap, kunst en literatuur, en heeft conflicten gekend zoals de Eerste Wereldoorlog en de Tweede Wereldoorlog. Na de oorlogen is Europa opnieuw opgebouwd en ontstaat er na de Tweede Wereldoorlog een Europese Unie die de vrede en welvaart in de regio heeft bevorderd.</p>',NULL,'afstandsleren',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(209,209,1,'Europese geschiedenis','2023-10-22 09:00:04','2023-10-22 09:00:04','8f1a5fe8-da9d-4ad3-949f-73e5a0ec9d06',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(210,210,1,'Europese geschiedenis','2023-10-22 09:00:07','2023-10-22 09:00:07','28cd8de7-249a-4b43-9f32-a6e7c5afafed','<p>Europa heeft een rijke en gevarieerde geschiedenis die teruggaat tot de prehistorie. Van de megalithische tempels op Malta en de Keltische nederzettingen in Ierland tot de klassieke oudheid van Griekenland en Rome, en de middeleeuwen met kastelen en kruistochten. Europa heeft ook belangrijke bijdragen geleverd aan de wetenschap, kunst en literatuur, en heeft conflicten gekend zoals de Eerste Wereldoorlog en de Tweede Wereldoorlog. Na de oorlogen is Europa opnieuw opgebouwd en ontstaat er na de Tweede Wereldoorlog een Europese Unie die de vrede en welvaart in de regio heeft bevorderd.</p>',NULL,'afstandsleren',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(211,211,1,'Het stenen tijdperk','2023-10-22 09:00:22','2023-10-22 09:02:48','031215c5-afc1-419f-b4ec-8f9fd55129f7','<p>Het stenen tijdperk is een prehistorische periode die tussen 2,5 miljoen en 5.000 jaar geleden plaatsvond. Gedurende deze periode gebruikten mensen stenen werktuigen en wapens om te jagen en voedsel te verzamelen. Het stenen tijdperk is verdeeld in drie perioden: het paleolithicum, het mesolithicum en het neolithicum. Tijdens het Paleolithicum waren mensen nomadisch en leefden ze in kleine groepen. Het Mesolithicum zag de ontwikkeling van de visserij en de landbouw, en het Neolithicum zag de komst van de landbouw en de opkomst van de eerste beschavingen. Het stenen tijdperk was een cruciale tijd in de menselijke geschiedenis en vormde onze evolutie en cultuur.</p>',NULL,'afstandsleren',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(212,212,1,'Stenen tijdperk','2023-10-22 09:02:46','2023-10-22 09:02:46','2ceeade5-471d-482e-927a-7ab929a852c1',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(213,213,1,'Het stenen tijdperk','2023-10-22 09:02:48','2023-10-22 09:02:48','2896be74-db84-4955-a0e0-9e1474ca2853','<p>Het stenen tijdperk is een prehistorische periode die tussen 2,5 miljoen en 5.000 jaar geleden plaatsvond. Gedurende deze periode gebruikten mensen stenen werktuigen en wapens om te jagen en voedsel te verzamelen. Het stenen tijdperk is verdeeld in drie perioden: het paleolithicum, het mesolithicum en het neolithicum. Tijdens het Paleolithicum waren mensen nomadisch en leefden ze in kleine groepen. Het Mesolithicum zag de ontwikkeling van de visserij en de landbouw, en het Neolithicum zag de komst van de landbouw en de opkomst van de eerste beschavingen. Het stenen tijdperk was een cruciale tijd in de menselijke geschiedenis en vormde onze evolutie en cultuur.</p>',NULL,'afstandsleren',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(214,214,1,'Het oude Egypte','2023-10-22 09:17:53','2023-10-22 09:21:24','7e720ea4-a45a-49b2-801b-62c75c57efee','<p>Het oude Egypte was een oude beschaving in Noord-Afrika die zich ontwikkelde langs de oevers van de rivier de Nijl. Het was een rijk en machtig rijk dat meer dan 3000 jaar aan de macht was, van ongeveer 3100 v.Chr. tot 30 v.Chr. Het oude Egypte was bekend om zijn architectuur, monumenten, kunst, religie en technologie, waaronder de bouw van piramides en het gebruik van hiërogliefen om te communiceren. Het was ook een van de eerste landen die zich ontwikkelden tot een georganiseerde samenleving met een schrift en een complexe bestuursstructuur.</p>',NULL,'afstandsleren',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(215,215,1,'Oude egypte','2023-10-22 09:21:22','2023-10-22 09:21:22','8645def5-521d-4352-a79e-8b3a8324cb85',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(216,216,1,'Het oude Egypte','2023-10-22 09:21:24','2023-10-22 09:21:24','781b81ed-c9d1-4325-8ff4-04a92a1a56bf','<p>Het oude Egypte was een oude beschaving in Noord-Afrika die zich ontwikkelde langs de oevers van de rivier de Nijl. Het was een rijk en machtig rijk dat meer dan 3000 jaar aan de macht was, van ongeveer 3100 v.Chr. tot 30 v.Chr. Het oude Egypte was bekend om zijn architectuur, monumenten, kunst, religie en technologie, waaronder de bouw van piramides en het gebruik van hiërogliefen om te communiceren. Het was ook een van de eerste landen die zich ontwikkelden tot een georganiseerde samenleving met een schrift en een complexe bestuursstructuur.</p>',NULL,'afstandsleren',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(217,217,1,'Oude Griekse geschiedenis','2023-10-22 09:21:54','2023-10-22 09:24:37','7ac4e972-b97d-4db8-9fe1-6d2660eddde6','<p>De oude Griekse geschiedenis strekt zich uit over meer dan duizend jaar en omvat de opkomst en de ondergang van verschillende beschavingen en rijken, zoals de Minoïsche, de Myceense, en de grote stadstaten Athene en Sparta. Een belangrijk aspect van de Griekse geschiedenis is de ontwikkeling van democratie, filosofie, kunst en architectuur. De Perzische oorlogen en de Peloponnesische oorlog vormen belangrijke gebeurtenissen in de geschiedenis, en de invloed van het oude Griekenland is nog steeds waarneembaar in onze hedendaagse cultuur.</p>',NULL,'afstandsleren',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(218,218,1,'Oude griekse geschiedenis','2023-10-22 09:24:35','2023-10-22 09:24:35','82cc4bb4-8397-4e89-9aa6-e7fb22ea884c',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(219,219,1,'Oude Griekse geschiedenis','2023-10-22 09:24:37','2023-10-22 09:24:37','9aaa9527-848d-45f0-91e5-3810ed1b0699','<p>De oude Griekse geschiedenis strekt zich uit over meer dan duizend jaar en omvat de opkomst en de ondergang van verschillende beschavingen en rijken, zoals de Minoïsche, de Myceense, en de grote stadstaten Athene en Sparta. Een belangrijk aspect van de Griekse geschiedenis is de ontwikkeling van democratie, filosofie, kunst en architectuur. De Perzische oorlogen en de Peloponnesische oorlog vormen belangrijke gebeurtenissen in de geschiedenis, en de invloed van het oude Griekenland is nog steeds waarneembaar in onze hedendaagse cultuur.</p>',NULL,'afstandsleren',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(220,220,1,'Oude Romeinse geschiedenis','2023-10-22 09:42:25','2023-10-22 09:44:04','531d29b1-a685-4d11-a6c7-0ed307824d0f','<p>De oude Romeinse geschiedenis is een fascinerend onderwerp vol met intriges, politieke onrust en militaire expansie. De oprichting van Rome wordt gedateerd tussen 753 en 509 v.Chr. Het Romeinse Rijk bloeide op tijdens de regering van keizer Augustus in de 1e eeuw na Christus en breidde zich uit over grote delen van Europa, Noord-Afrika en Azië. Het Romeinse leger was een belangrijke factor in het succes van het rijk en de Romeinse wetgeving, architectuur en engineering hebben een blijvende invloed gehad op de westerse beschaving. Het rijk stortte uiteindelijk ineen in de 5e eeuw na Christus.</p>',NULL,'afstandsleren',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(221,221,1,'Oude romeinse geschiedenis','2023-10-22 09:44:00','2023-10-22 09:44:00','0a895b99-ba9f-44d8-afac-8de54efe1fa2',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(222,222,1,'Oude Romeinse geschiedenis','2023-10-22 09:44:04','2023-10-22 09:44:04','76ea4a89-4e47-46cf-9614-80f3e65e27a1','<p>De oude Romeinse geschiedenis is een fascinerend onderwerp vol met intriges, politieke onrust en militaire expansie. De oprichting van Rome wordt gedateerd tussen 753 en 509 v.Chr. Het Romeinse Rijk bloeide op tijdens de regering van keizer Augustus in de 1e eeuw na Christus en breidde zich uit over grote delen van Europa, Noord-Afrika en Azië. Het Romeinse leger was een belangrijke factor in het succes van het rijk en de Romeinse wetgeving, architectuur en engineering hebben een blijvende invloed gehad op de westerse beschaving. Het rijk stortte uiteindelijk ineen in de 5e eeuw na Christus.</p>',NULL,'afstandsleren',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(223,223,1,'Toegepaste psychologie','2023-10-22 09:50:50','2023-10-22 09:51:20','424f7d37-5a88-4ba8-a80c-14f566613721','<p>Toegepaste psychologie bestudeert de manier waarop psychologische principes en technieken kunnen worden toegepast in het dagelijks leven, in verschillende contexten, zoals in organisaties, de gezondheidszorg, in het onderwijs, enz. Het gaat erom te begrijpen hoe mensen denken, voelen en handelen in verschillende situaties en om deze kennis te gebruiken om gedrag te veranderen en te verbeteren. Toegepaste psychologie kan worden gebruikt om problemen op te lossen, beslissingen te nemen, en om persoonlijke groei en ontwikkeling te stimuleren. Verschillende specialisaties binnen toegepaste psychologie zijn onder meer forensische psychologie, sportpsychologie en klinische psychologie.</p>',NULL,'contactonderwijs',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(224,224,1,'Toegepaste psychologie','2023-10-22 09:51:18','2023-10-22 09:51:18','8afe2c60-4822-4540-b477-1fdf1030b866',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(225,225,1,'Toegepaste psychologie','2023-10-22 09:51:20','2023-10-22 09:51:20','7e61b1d3-3a19-4355-920e-606f8af1f63d','<p>Toegepaste psychologie bestudeert de manier waarop psychologische principes en technieken kunnen worden toegepast in het dagelijks leven, in verschillende contexten, zoals in organisaties, de gezondheidszorg, in het onderwijs, enz. Het gaat erom te begrijpen hoe mensen denken, voelen en handelen in verschillende situaties en om deze kennis te gebruiken om gedrag te veranderen en te verbeteren. Toegepaste psychologie kan worden gebruikt om problemen op te lossen, beslissingen te nemen, en om persoonlijke groei en ontwikkeling te stimuleren. Verschillende specialisaties binnen toegepaste psychologie zijn onder meer forensische psychologie, sportpsychologie en klinische psychologie.</p>',NULL,'contactonderwijs',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(226,226,1,'Cognitieve psychologie','2023-10-22 09:52:03','2023-10-22 09:56:38','6ae8106d-72b3-46bb-8f5b-364d6d5658b8','<p>Cognitieve psychologie is een tak van de psychologie die zich richt op mentale processen zoals waarneming, aandacht, geheugen, taalverwerking en besluitvorming. Het onderzoek binnen de cognitieve psychologie richt zich op het begrijpen van hoe mensen informatie verwerken en gebruiken om te reageren op hun omgeving. Dit kan bijvoorbeeld worden toegepast bij de ontwikkeling van leertechnologieën, cognitieve therapiesessies en de behandeling van aandoeningen zoals Alzheimer\'s.</p>',NULL,'contactonderwijs',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(227,227,1,'Cognitieve psychologie','2023-10-22 09:56:36','2023-10-22 09:56:36','1dce0449-522b-48a5-b867-68feabd244a9',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(228,228,1,'Cognitieve psychologie','2023-10-22 09:56:38','2023-10-22 09:56:38','2b8248ec-e2f0-4e78-b88e-e2257d85dfcd','<p>Cognitieve psychologie is een tak van de psychologie die zich richt op mentale processen zoals waarneming, aandacht, geheugen, taalverwerking en besluitvorming. Het onderzoek binnen de cognitieve psychologie richt zich op het begrijpen van hoe mensen informatie verwerken en gebruiken om te reageren op hun omgeving. Dit kan bijvoorbeeld worden toegepast bij de ontwikkeling van leertechnologieën, cognitieve therapiesessies en de behandeling van aandoeningen zoals Alzheimer\'s.</p>',NULL,'contactonderwijs',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(229,229,1,'Psychoanalyse','2023-10-22 09:57:23','2023-10-22 10:00:20','d1211143-4351-4ebe-bb9e-7decb67d27e9','<p>Psychoanalyse is een therapeutische benadering die probeert onbewuste conflicten en onderdrukte emoties, waarvan wordt gedacht dat ze bijdragen aan psychologische problemen, bloot te leggen en aan te pakken. De psychoanalyse, ontwikkeld door Sigmund Freud, omvat het onderzoeken van iemands ervaringen uit de vroege kinderjaren en de onbewuste geest door middel van vrije associatie, droomanalyse en overdracht met de therapeut. Het overkoepelende doel van de psychoanalyse is het vergroten van het zelfbewustzijn en het bevorderen van genezing en groei door onderdrukte gedachten en emoties in het bewuste bewustzijn te brengen. Hoewel de psychoanalyse bekritiseerd is vanwege het gebrek aan empirische ondersteuning en de lange tijdsinvestering, vinden sommige mensen het een nuttige behandeling voor een verscheidenheid aan geestelijke gezondheidsproblemen.</p>',NULL,'contactonderwijs',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(230,230,1,'Psychoanalyse','2023-10-22 09:59:52','2023-10-22 09:59:52','c345e327-f500-48d5-b7d7-26d34f2f2998',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(231,231,1,'Psychoanalyse','2023-10-22 09:59:54','2023-10-22 09:59:54','f8f74a76-6abd-4004-8b47-8a062ee49379','<p>Psychoanalysis is a therapeutic approach that attempts to uncover and address unconscious conflicts and repressed emotions that are thought to contribute to psychological distress. Developed by Sigmund Freud, psychoanalysis involves exploring a person\'s early childhood experiences and unconscious mind through free association, dream analysis, and transference with the therapist. The overarching goal of psychoanalysis is to increase self-awareness and promote healing and growth by bringing repressed thoughts and emotions into conscious awareness. While psychoanalysis has been criticized for its lack of empirical support and lengthy time commitment, some individuals find it to be a helpful treatment for a variety of mental health concerns.</p>',NULL,'contactonderwijs',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(233,233,1,'Psychoanalyse','2023-10-22 10:00:20','2023-10-22 10:00:20','485aec1a-1705-4b9c-8487-ce71bdd7da22','<p>Psychoanalyse is een therapeutische benadering die probeert onbewuste conflicten en onderdrukte emoties, waarvan wordt gedacht dat ze bijdragen aan psychologische problemen, bloot te leggen en aan te pakken. De psychoanalyse, ontwikkeld door Sigmund Freud, omvat het onderzoeken van iemands ervaringen uit de vroege kinderjaren en de onbewuste geest door middel van vrije associatie, droomanalyse en overdracht met de therapeut. Het overkoepelende doel van de psychoanalyse is het vergroten van het zelfbewustzijn en het bevorderen van genezing en groei door onderdrukte gedachten en emoties in het bewuste bewustzijn te brengen. Hoewel de psychoanalyse bekritiseerd is vanwege het gebrek aan empirische ondersteuning en de lange tijdsinvestering, vinden sommige mensen het een nuttige behandeling voor een verscheidenheid aan geestelijke gezondheidsproblemen.</p>',NULL,'contactonderwijs',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(234,234,1,'Hermeneutiek','2023-10-22 10:01:26','2023-10-22 10:04:35','60696c17-2051-45f3-b940-53e6707fc85b','<p>Hermeneutiek is de theorie en methodologie van interpretatie, in het bijzonder de interpretatie van teksten, zoals religieuze teksten, filosofische teksten en literaire teksten. Dit vakgebied behandelt verschillende benaderingen van het interpreteren van teksten, waaronder contextuele, historische, taalkundige en culturele analyse. Hermeneutiek is toegepast op een breed scala aan gebieden, van recht en ethiek tot psychologie en theologie. Het uiteindelijke doel van de hermeneutiek is het blootleggen van de betekenis en betekenis van een tekst, die vaak wordt gezien als gelaagd en afhankelijk van het perspectief en de achtergrond van de lezer.</p>',NULL,'afstandsleren',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(235,235,1,'Hermeneutiek','2023-10-22 10:04:30','2023-10-22 10:04:30','7a82cd8c-c387-4130-bc4c-0385dd96ebf6',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(236,236,1,'Hermeneutiek','2023-10-22 10:04:35','2023-10-22 10:04:35','89c78a7a-58ac-4d96-9132-ffa409012891','<p>Hermeneutiek is de theorie en methodologie van interpretatie, in het bijzonder de interpretatie van teksten, zoals religieuze teksten, filosofische teksten en literaire teksten. Dit vakgebied behandelt verschillende benaderingen van het interpreteren van teksten, waaronder contextuele, historische, taalkundige en culturele analyse. Hermeneutiek is toegepast op een breed scala aan gebieden, van recht en ethiek tot psychologie en theologie. Het uiteindelijke doel van de hermeneutiek is het blootleggen van de betekenis en betekenis van een tekst, die vaak wordt gezien als gelaagd en afhankelijk van het perspectief en de achtergrond van de lezer.</p>',NULL,'afstandsleren',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(237,237,1,'Bijbels Hebreeuws','2023-10-22 10:04:42','2023-10-22 10:07:22','328c9dbf-56b3-4aa2-9fa1-25e76ad0723b','<p>Bijbels Hebreeuws is de variant van de Hebreeuwse taal die in de bijbel wordt gebruikt. Het is een oude vorm van Hebreeuws dat sterk verschilt van het moderne Hebreeuws dat vandaag de dag wordt gesproken in Israël. Het Bijbels Hebreeuws bestaat uit verschillende dialecten die werden gesproken door de verschillende stammen en volkeren in het oude Israël. Het is een taal die van grote historische en religieuze betekenis is en die nog steeds wordt bestudeerd en geleerd door mensen over de hele wereld.</p>',NULL,'afstandsleren',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(238,238,1,'Bijbels hebreeuws','2023-10-22 10:07:21','2023-10-22 10:07:21','ca30ee01-5242-4041-b572-99b08b4026ce',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(239,239,1,'Bijbels Hebreeuws','2023-10-22 10:07:22','2023-10-22 10:07:22','8901ecf8-2c8a-499b-b17e-3be22d4fd799','<p>Bijbels Hebreeuws is de variant van de Hebreeuwse taal die in de bijbel wordt gebruikt. Het is een oude vorm van Hebreeuws dat sterk verschilt van het moderne Hebreeuws dat vandaag de dag wordt gesproken in Israël. Het Bijbels Hebreeuws bestaat uit verschillende dialecten die werden gesproken door de verschillende stammen en volkeren in het oude Israël. Het is een taal die van grote historische en religieuze betekenis is en die nog steeds wordt bestudeerd en geleerd door mensen over de hele wereld.</p>',NULL,'afstandsleren',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(240,240,1,'Ecclesiologie','2023-10-22 10:07:48','2023-10-22 10:09:44','c57f9060-d8c3-4be9-8e7c-2318875fc509','<p>Ecclesiologie is de tak van de theologie die zich bezighoudt met de aard, structuur en functies van de christelijke kerk. Het onderzoekt onderwerpen als de oorsprong en ontwikkeling van de Kerk, de sacramenten, het ambt en de relatie tussen de Kerk en de samenleving. De ecclesiologie behandelt ook kwesties van de oecumene, of de pogingen om de eenheid en samenwerking tussen verschillende christelijke denominaties te bevorderen. Uiteindelijk probeert de ecclesiologie de essentiële rol te begrijpen die de Kerk speelt in de levens van gelovigen en in de wijdere wereld.</p>',NULL,'afstandsleren',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(241,241,1,'Ecclesiologie','2023-10-22 10:09:42','2023-10-22 10:09:42','49f7bcfe-9162-4a46-82d2-0f76f2874798',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(242,242,1,'Ecclesiologie','2023-10-22 10:09:44','2023-10-22 