el, zoals de soevereiniteit van God, verlossing door geloof in Jezus Christus, en het priesterschap van alle gelovigen. Protestantse theologen kunnen ook kwesties onderzoeken zoals de rol van de kerk, de aard van God en de christelijke ethiek. Het vakgebied heeft zijn wortels in de Reformatie en heeft door de geschiedenis heen bijgedragen aan de diversiteit van het christelijke denken.</p>',NULL,'afstandsleren',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(312,312,1,'Engelse poëzie','2023-10-22 15:37:28','2023-10-22 15:41:56','cd25e812-d3c8-4cb5-a423-b1e07bcb2dcd','<p>Engelse poëzie heeft een rijke geschiedenis en een breed scala aan stijlen, van de romantiek van William Wordsworth tot het modernisme van T.S. Eliot. Het onderzoekt vaak thema\'s als liefde, de natuur, sociale kwesties en de menselijke conditie. Dichters als William Shakespeare, John Keats en Emily Bronte worden herinnerd vanwege hun bijdragen aan het vak, en hedendaagse dichters als Carol Ann Duffy en Simon Armitage blijven met hun werk grenzen verleggen. Ondanks de evolutie van het genre ligt de kracht van Engelse poëzie nog steeds in het vermogen om emoties op te roepen en op een diep niveau contact te maken met lezers.</p>',NULL,'afstandsleren',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(313,313,1,'Engelse poëzie','2023-10-22 15:41:42','2023-10-22 15:41:42','a02f08a8-3253-4eb0-afce-23dcd9ade0b9',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(314,314,1,'Engelse poëzie','2023-10-22 15:41:56','2023-10-22 15:41:56','78911bfe-7530-4a72-95ee-46baaf8dd55c','<p>Engelse poëzie heeft een rijke geschiedenis en een breed scala aan stijlen, van de romantiek van William Wordsworth tot het modernisme van T.S. Eliot. Het onderzoekt vaak thema\'s als liefde, de natuur, sociale kwesties en de menselijke conditie. Dichters als William Shakespeare, John Keats en Emily Bronte worden herinnerd vanwege hun bijdragen aan het vak, en hedendaagse dichters als Carol Ann Duffy en Simon Armitage blijven met hun werk grenzen verleggen. Ondanks de evolutie van het genre ligt de kracht van Engelse poëzie nog steeds in het vermogen om emoties op te roepen en op een diep niveau contact te maken met lezers.</p>',NULL,'afstandsleren',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(315,315,1,'Engelse literatuur','2023-10-22 15:42:36','2023-10-22 15:44:33','60178eaf-7c33-46e8-b115-96243a6ea795','<p>Engelse literatuur verwijst naar literaire werken geschreven in de Engelse taal, waaronder romans, gedichten en toneelstukken. Het heeft een rijke geschiedenis die teruggaat tot de Middeleeuwen en heeft enkele van de beroemdste schrijvers ter wereld voortgebracht, zoals William Shakespeare, Charles Dickens, Jane Austen en Virginia Woolf. Van de Renaissance tot de moderne tijd is de Engelse literatuur geëvolueerd en aangepast om de veranderende sociale, culturele en politieke contexten te weerspiegelen, waardoor het een fascinerend en divers studiegebied is geworden.</p>',NULL,'afstandsleren',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(316,316,1,'Engelse literatuur','2023-10-22 15:44:32','2023-10-22 15:44:32','b7a2c5eb-bd9a-493a-a165-21f1b742fa7a',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(317,317,1,'Engelse literatuur','2023-10-22 15:44:33','2023-10-22 15:44:33','2b5c7033-67ff-4d56-993a-8a6dc246378a','<p>Engelse literatuur verwijst naar literaire werken geschreven in de Engelse taal, waaronder romans, gedichten en toneelstukken. Het heeft een rijke geschiedenis die teruggaat tot de Middeleeuwen en heeft enkele van de beroemdste schrijvers ter wereld voortgebracht, zoals William Shakespeare, Charles Dickens, Jane Austen en Virginia Woolf. Van de Renaissance tot de moderne tijd is de Engelse literatuur geëvolueerd en aangepast om de veranderende sociale, culturele en politieke contexten te weerspiegelen, waardoor het een fascinerend en divers studiegebied is geworden.</p>',NULL,'afstandsleren',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(320,320,1,'School of Com