Museum voor Schone Kunsten, allemaal op wandelafstand van de Voetweg.</p><h3>Voorzieningen</h3><ul><li>88 leslokalen en 5 aula\'s</li><li>Studentenresto en -cafetaria</li><li>Toegankelijk voor personen met een beperkte mobiliteit</li><li>Up-to-date mediatheek</li><li>Wintertuin</li><li>Overdekte fietsenstalling</li><li>Douches voor studenten en medewerkers</li></ul><p> </p>'),(399,537,1,'Kantienberg','2023-10-24 08:30:18','2023-10-24 10:12:29','24af3542-c7bb-4c74-804c-47a7b942755f',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<h1>Campus Kantienberg</h1><p>Voetweg 66, 9000 Gent</p><p>Onze grootste campus, campus Kantienberg, is gelegen midden in de studentenbuurt vol hippe horecazaken en grote parken. Met een moderne mediatheek, verschillende ontspanningsruimtes en een eigen studentenrestaurant ‘De Kantiene’ is deze campus helemaal op maat van onze studenten.</p><p><img src=\"https://ahscdn.be/sites/default/files/styles/background_image_xs/public/2022-12/ahs_campus_kantienberg.jpg.webp?itok=mSuTWj_D\" alt=\"\" /></p><p>Campus Kantienberg ligt in het hart van Gent: vlak bij het Citadelpark, het Sint-Pietersplein en de studentenbuurt Overpoort. Er is dus geen gebrek aan koffiebars of broodjeszaken waar studenten tussen de lesuren even kunnen ontspannen. </p><p>Tegenover onze campus ligt de Kinepolis, het decor voor het jaarlijkse Filmfestival van Gent. Voor nog meer cultuur kunnen studenten terecht in de Vooruit, het S.M.A.K. of het Museum voor Schone Kunsten, allemaal op wandelafstand van de Voetweg.</p><h3>Contact</h3><p>☎ 09 234 70 00</p><p><a href=\"mailto:onthaalkantienberg@arteveldehs.be\">onthaalkantienberg@arteveldehs.be</a></p><p>Voorzieningen</p><ul><li>88 leslokalen en 5 aula\'s</li><li>Studentenresto en -cafetaria</li><li>Toegankelijk voor personen met een beperkte mobiliteit</li><li>Up-to-date mediatheek</li><li>Wintertuin</li><li>Overdekte fietsenstalling</li><li>Douches voor studenten en medewerkers</li></ul>'),(401,539,1,'Kantienberg','2023-1