','0fe77d60-bbef-470b-a12e-f6eabd6439e2',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(439,577,1,'Campus Hoogpoort','2023-10-24 09:29:06','2023-10-24 10:12:30','38023523-c9a4-4577-886a-46c23ae950c2',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<h3>Hoogpoort 15, 9000 Gent</h3><p>Campus Hoogpoort is de thuisbasis van de algemene diensten en de directie van Arteveldehogeschool. Er gaan geen lessen door op deze campus.</p><figure class=\"image\"><img src=\"{asset:592:url||https://my-school.ddev.site/uploads/campus/hoogpoort.webp}\" alt=\"\" /></figure><p>Campus Hoogpoort ligt midden in het historische stadscentrum van Gent. De Korenmarkt, de Gras- en Korenlei, het Gravensteen, het Patershol en de Veldstraat liggen op wandelafstand. </p><h3>Bereikbaarheid</h3><h4>Met de fiets</h4><p>Er is een fietsenstalling schuin tegenover campus Hoogpoort. </p><h4>Met het openbaar vervoer</h4><ul><li>Vanaf Sint-Pietersstation: neem tram 1 richting Wondelgem of Evergem tot aan de halte ‘Korenmarkt\'. Ga te voet via het Emile Braunplein en de Stadhuissteeg naar de campus in de Hoogpoort.</li><li>Vanaf Dampoortstation: neem bus 3 richting Mariakerke Post of bus 38/39 richting Blaarmeersen tot aan de halte ‘Gent Stadhuis’. Wandel via het Emile Braunplein en de Stadhuissteeg naar campus Hoogpoort.  </li></ul><h4>Met de auto</h4><ul><li>Wie met de wagen komt, parkeert best in <a href=\"http://mobiliteit.stad.gent/met-de-auto/ondergrondse-parkings\">een ondergrondse parkeergarage</a> (Vrijdagmarkt, Reep, Sint-Michiels of Ramen).</li><li>Vanaf 1 januari 2020 bant Gent de meest vervuilende auto’s uit de binnenstad. Campus Hoogpoort ligt in de nieuwe lage-emissiezone (LEZ). Benzinewagens vanaf euronorm 2 zijn nog toegelaten in die zone, diesels moeten aan de euronorm 5 voldoen. Meer info op <a href=\"http://www.lez2020.gent/\">www.lez2020.gent</a>.</li></ul><p> </p>'),(440,578,1,'Campus Hoogpoort','2023-10-24 09:30:23','2023-10-24 10:12:31','463e13d9-cf76-4937-a8cf-54