h3>Voorzieningen</h3><ul><li>Multimedialabs</li><li>Print &amp; sign labs</li><li>Studio\'s voor multicam &amp; streaming</li><li>Schetsterras</li><li>Fotostudio</li><li>Geluidsstudio</li><li>Overdekte fietsenstalling</li><li>Parkeerplaats voor studenten</li></ul><h3>Bereikbaarheid</h3><h4>Te voet of met de fiets</h4><p>Vanaf Sint-Pietersstation duurt de wandeling naar campus Kattenberg een goed kwartier. Met de fiets leg je het traject af op een vijftal minuten. Er ligt een grote overdekte fietsstalling aan de campus.</p><h4>Met het openbaar vervoer</h4><ul><li>Vanaf Sint-Pietersstation: neem tram 1 richting Evergem of Wondelgem tot aan de halte ‘Veergrep’. Ga te voet via de Kannunikstraat en de H. Metdepenningenstraat richting onze campus. </li><li>Vanaf het station Gent Dampoort: neem bus 34, 35, 36, 70, 71, 72, 76, 77 of 78 tot de halte ‘Heuvelpoort’. Via de Charles De Kerckhovelaan wandel je vervolgens richting Kattenberg. </li></ul><h4>Met de auto</h4><ul><li>Je parkeert best onder het <a href=\"https://mobiliteit.stad.gent/p10-sint-pietersplein\">Sint-Pietersplein</a> als je met de wagen naar campus Kattenberg komt. </li><li>Vanaf 1 januari 2020 bant Gent de meest vervuilende auto’s uit de binnenstad. Campus Kattenberg ligt in de nieuwe lage-emissiezone (LEZ). Benzinewagens vanaf euronorm 2 zijn nog toegelaten in die zone, diesels moeten aan de euronorm 5 voldoen. Meer info op <a href=\"http://www.lez2020.gent/\">www.lez2020.gent</a>.</li></ul><p> </p>'),(446,584,1,'Campus Kattenberg','2023-10-24 09:34:53','2023-10-24 10:12:31','2afd0aa2-20fc-4a46-bd50-37cc0d487c28',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<h3>Kattenberg 9, 9000 Gent</h3><p>Campus Kattenberg is de thuisbasis van de opleidingen tot leraar secundair onderwijs. Ongeveer 2000 studenten volgen les op deze campus en er worden ook heel wat nascholingen georganiseerd.</p><p><img src=\"https://ahscdn.be/sites/default/files/styles/background_image_xs/public/2022-12/campus-kattenberg-arteveldehogeschool.png.webp?itok=UmnsiYg1\" alt=\"\" /></p><p>Onze opleiding Bachelor Grafische en Digitale Media vind je op onze mediacampus in Mariakerke. Met een eigen drukkerij, foto- en geluidsstudio en verschillende medialabs is deze campus helemaal op maat van de creatieve student. Vanaf het station Gent Sint-Pieters en De Zuid zijn er rechtstreekse snelbussen naar de campus. Kom je liever met de wagen? Aan de campus zijn er voldoende parkeermogelijkheden. Maar ook via de fietssnelweg raak je er snel.</p><h3>Voorzieningen</h3><ul><li>Multimedialabs</li><li>Print &amp; sign labs</li><li>Studio\'s voor multicam &amp; streaming</li><li>Schetsterras</li><li>Fotostudio</li><li>Geluidsstudio</li><li>Overdekte fietsenstalling</li><li>Parkeerplaats voor studenten</li></ul><h3>Bereikbaarheid</h3><h4>Met de fiets</h4><ul><li>Als je in Gent centrum vertrekt, ben je met de fiets ongeveer twintig minuten onderweg naar campus Mariakerke. Je rijdt  zo goed als het volledige traject langs de Brugse Vaart. </li><li>Volg achtereenvolgens Coupure Links, Zuidkaai, Groendreef, Gérard Willemotlaan en Trekweg. Sla links af aan de Vinderhoutsedam en rij vervolgens door de fietstunnel en over de brug van de R4 tot aan onze campus. </li></ul><h4>Met het openbaar vervoer</h4><ul><li>Aan het Sint-Pietersstation kan je bus 65 of 67 nemen. Stap af aan de halte ‘Industrieweg’ en volg de Speystraat ongeveer 300 meter richting onze mediacampus.</li><li>Voor de meest actuele informatie en reistijden kan je terecht op de <a href=\"http://www.delijn.be/\">website van De Lijn</a>.</li></ul><h4>Met de auto</h4><p>Campus Mariakerke ligt dicht bij het kruispunt van de R4 (de ring rond Gent) en de N9 die Gent met Eeklo verbindt. Ruime parking voorzien op de campus.</p><p> </p>'),(448,586,1,'Missie en visie','2023-10-24 09:38:06','2023-10-24 10:12:31','84373bb6-c77b-4e90-abc2-6c733738c181',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<p><strong>Lorem ipsum</strong> dolor sit amet, consectetue