ruispunt van de R4 (de ring rond Gent) en de N9 die Gent met Eeklo verbindt. Ruime parking voorzien op de campus.</p><p> </p>'),(452,590,1,'Campus Mariakerke','2023-10-24 09:45:55','2023-10-24 10:12:31','46c5604a-4e9f-4558-99c6-2b93c1a28d92',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<h3>Industrieweg 232, 9030 Mariakerke</h3><p>We noemen campus Mariakerke ook wel eens de mediacampus van Arteveldehogeschool. Het is dan ook de thuisbasis van de Bachelor Grafische en Digitale Media.</p><p><img src=\"https://ahscdn.be/sites/default/files/styles/background_image_xs/public/2022-12/campus_mariakerke_0.jpg.webp?itok=aWMYhcR0\" alt=\"\" /></p><p>Onze opleiding Bachelor Grafische en Digitale Media vind je op onze mediacampus in Mariakerke. Met een eigen drukkerij, foto- en geluidsstudio en verschillende medialabs is deze campus helemaal op maat van de creatieve student. Vanaf het station Gent Sint-Pieters en De Zuid zijn er rechtstreekse snelbussen naar de campus. Kom je liever met de wagen? Aan de campus zijn er voldoende parkeermogelijkheden. Maar ook via de fietssnelweg raak je er snel.</p><h3>Voorzieningen</h3><ul><li>Multimedialabs</li><li>Print &amp; sign labs</li><li>Studio\'s voor multicam &amp; streaming</li><li>Schetsterras</li><li>Fotostudio</li><li>Geluidsstudio</li><li>Overdekte fietsenstalling</li><li>Parkeerplaats voor studenten</li></ul><h3>Bereikbaarheid</h3><h4>Met de fiets</h4><ul><li>Als je in Gent centrum vertrekt, ben je met de fiets ongeveer twintig minuten onderweg naar campus Mariakerke. Je rijdt  zo goed als het volledige traject langs de Brugse Vaart. </li><li>Volg achtereenvolgens Coupure Links, Zuidkaai, Groendreef, Gérard Willemotlaan en Trekweg. Sla links af aan de Vinderhoutsedam en rij vervolgens door de fietstunnel en over de brug van de R4 tot aan onze campus. </li></ul><h4>Met het openbaar vervoer</h4><ul><li>Aan het Sint-Pietersstation kan je bus 65 of 67 nemen. Stap af aan de halte ‘Industrieweg’ en volg de Speystraat ongeveer 300 meter richting onze mediacampus.</li><li>Voor de meest actuele informatie en reistijden kan je terecht op de <a href=\"http://www.delijn.be/\">website van De Lijn</a>.</li></ul><h4>Met de auto</h4><p>Campus Mariakerke ligt dicht bij het kruispunt van de R4 (de ring rond Gent) en de N9 die Gent met Eeklo verbindt. Ruime parking voorzien op de campus.</p><p> </p>'),(454,592,1,'Hoogpoort','2023-10-24 09:50:26','2023-10-24 09:50:26','b6ea76d5-8907-47d3-8e16-10f460ea39fc',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(455,593,1,'Kantienberg','2023-10-24 09:50:26','2023-10-24 09:50:26','88ef7891-cafa-45c0-9df8-3f02c05154b8',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(456,594,1,'Kattenberg','2023-10-24 09:50:26','2023-10-24 09:50:26','54384215-180c-411e-b376-c03842ec6759',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(457,595,1,'Mariakerke','2023-10-24 09:50:26','2023-10-24 09:50:26','05ce6a88-f92a-45bb-9d74-640465e3c682',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(458,596,1,'Campus Kantienberg','2023-10-24 09:51:05','2023-10-24 10:12:31','8c56239c-0668-43b2-a47d-10dbc3e4ae9c',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<h3>Voetweg 66, 9000 Gent</h3><p>Onze grootste campus, campus Kantienberg, is gelegen midden in de studentenbuurt vol hippe horecazaken en grote parken. Met een moderne mediatheek, verschillende ontspanningsruimtes en een eigen studentenrestaurant ‘De Kantiene’ is deze campus helemaal op maat van onze studenten.</p><figure class=\"image\"><img src=\"{asset:593:url||https://my-school.ddev.site/uploads/campus/kantienberg.webp}\" alt=\"\" /></figure><p>Campus Kantienberg ligt in het hart van Gent: vlak bij het Citadelpark, het Sint-Pietersplein en de studentenbuurt Overpoort. Er is dus geen gebrek aan koffiebars of broodjeszaken waar studenten tussen de lesuren even kunnen ontspannen. </p><p>Tegenover onze campus ligt de Kinepolis, het decor voor het jaarlijkse Filmfestival van Gent. Voor nog meer cultuur kunnen studenten terecht in de Vooruit, het S.M.A.K. of het Museum voor Schone Kunsten, allemaal op wandelafstand van de Voetweg.</p><h3>Voorzieningen</h3><ul><li>88 leslokalen en 5 aula\'s</li><li>Studentenresto en -cafetaria</li><li>Toegankelijk voor personen met een beperkte mobiliteit</li><li>Up-to-date mediatheek</li><li>Wintertuin</li><li>Overdekte fietsenstalling</li><li>Douches voor studenten en medewerkers</li></ul><p> </p>'),(460,598,1,'Campus Hoogpoort','2023-10-24 09:51:46','2023-10-24 10:12:31','87b91ba2-746a-4cc0-bc39-e9506150bb3b',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<h3>Hoogpoort 15, 9000 Gent</h3><p>Campus Hoogpoort is de thuisbasis van de algemene diensten en de directie van Arteveldehogeschool. Er gaan geen lessen door op deze campus.</p><figure class=\"image\"><img src=\"{asset:592:url||https://my-school.ddev.site/uploads/campus/hoogpoort.webp}\" alt=\"\" /></figure><p>Campus Hoogpoort ligt midden in het historische stadscentrum van Gent. De Korenmarkt, de Gras- en Korenlei, het Gravensteen, het Patershol en de Veldstraat liggen op wandelafstand. </p><h3>Bereikbaarheid</h3><h4>Met de fiets</h4><p>Er is een fietsenstalling schuin tegenover campus Hoogpoort. </p><h4>Met het openbaar vervoer</h4><ul><li>Vanaf Sint-Pietersstation: neem tram 1 richting Wondelgem of Evergem tot aan de halte ‘Korenmarkt\'. Ga te voet via het Emile Braunplein en de Stadhuissteeg naar de campus in de Hoogpoort.</li><li>Vanaf Dampoortstation: neem bus 3 richting Mariakerke Post of bus 38/39 richting Blaarmeersen tot aan de halte ‘Gent Stadhuis’. Wandel via het Emile Braunplein en de Stadhuissteeg naar campus Hoogpoort.  </li></ul><h4>Met de auto</h4><ul><li>Wie met de wagen komt, parkeert best in <a href=\"http://mobiliteit.stad.gent/met-de-auto/ondergrondse-parkings\">een ondergrondse parkeergarage</a> (Vrijdagmarkt, Reep, Sint-Michiels of Ramen).</li><li>Vanaf 1 januari 2020 bant Gent de meest vervuilende auto’s uit de binnenstad. Campus Hoogpoort ligt in de nieuwe lage-emissiezone (LEZ). Benzinewagens vanaf euronorm 2 zijn nog toegelaten in die zone, diesels moeten aan de euronorm 5 voldoen. Meer info op <a href=\"http://www.lez2020.gent/\">www.lez2020.gent</a>.</li></ul><p> </p>'),(462,600,1,'Campus Kattenberg','2023-10-24 09:52:22','2023-10-24 10:12:31','896c269c-8f7c-4e1a-bf29-a0132be10699',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<h3>Kattenberg 9, 9000 Gent</h3><p>Campus Kattenberg is de thuisbasis van de opleidingen tot leraar secundair onderwijs. Ongeveer 2000 studenten volgen les op deze campus en er worden ook heel wat nascholingen georganiseerd.</p><figure class=\"image\"><img src=\"{asset:594:url||https://my-school.ddev.site/uploads/campus/kattenberg.webp}\" alt=\"\" /></figure><p>Onze opleiding Bachelor Grafische en Digitale Media vind je op onze mediacampus in Mariakerke. Met een eigen drukkerij, foto- en geluidsstudio en verschillende medialabs is deze campus helemaal op maat van de creatieve student. Vanaf het station Gent Sint-Pieters en De Zuid zijn er rechtstreekse snelbussen naar de campus. Kom je liever met de wagen? Aan de campus zijn er voldoende parkeermogelijkheden. Maar ook via de fietssnelweg raak je er snel.</p><h3>Voorzieningen</h3><ul><li>Multimedialabs</li><li>Print &amp; sign labs</li><li>Studio\'s voor multicam &amp; streaming</li><li>Schetsterras</li><li>Fotostudio</li><li>Geluidsstudio</li><li>Overdekte fietsenstalling</li><li>Parkeerplaats voor studenten</li></ul><h3>Bereikbaarheid</h3><h4>Te voet of met de fiets</h4><p>Vanaf Sint-Pietersstation duurt de wandeling naar campus Kattenberg een goed kwartier. Met de fiets leg je het traject af op een vijftal minuten. Er ligt een grote overdekte fietsstalling aan de campus.</p><h4>Met het openbaar vervoer</h4><ul><li>Vanaf Sint-Pietersstation: neem tram 1 richting Evergem of Wondelgem tot aan de halte ‘Veergrep’. Ga te voet via de Kannunikstraat en de H. Metdepenningenstraat richting onze c