INSERT INTO `matrixcontent_articlecontent` VALUES (1,321,1,'2023-10-23 07:59:56','2023-10-23 07:59:56','764e9ed3-c830-4a80-9a71-d44ce25b73a6',NULL,NULL),(2,322,1,'2023-10-23 08:00:09','2023-10-23 08:00:09','384c1d4e-dd71-4a4e-beeb-f2f29c63154e','<p>De School of Computer Science van de XYZ University maakt met trots bekend dat zij voor het derde achtereenvolgende jaar tot de top vijf van computerwetenschappenscholen van het land behoort. De ranglijst van de prestigieuze publicatie US News &amp; World Report houdt rekening met factoren zoals academische reputatie, onderzoeksfinanciering en studentenresultaten. Deze prestatie is een bewijs van het harde werk en de toewijding van onze docenten, medewerkers en studenten, en bevestigt opnieuw onze toewijding aan het bieden van onderwijs en onderzoek van wereldklasse op het gebied van de informatica.</p>',NULL),(3,323,1,'2023-10-23 08:00:14','2023-10-23 08:00:14','ac666efd-6eeb-4de5-8d6d-19d433a6a274','<p>Onze partnerDe School of Computer Science van de XYZ University maakt met trots bekend dat zij voor het derde achtereenvolgende jaar tot de top vijf van computerwetenschappenscholen van het land behoort. De ranglijst van de prestigieuze publicatie US News &amp; World Report houdt rekening met factoren zoals academische reputatie, onderzoeksfinanciering en studentenresultaten. Deze prestatie is een bewijs van het harde werk en de toewijding van onze docenten, medewerkers en studenten, en bevestigt opnieuw onze toewijding aan het bieden van onderwijs en onderzoek van wereldklasse op het gebied van de informatica.</p>',NULL),(4,324,1,'2023-10-23 08:00:16','2023-10-23 08:00:16','b61eeb2e-88f6-4327-bac1-80d76074ecbb','<p>Onze partner De School of Computer Science van de XYZ University maakt met trots bekend dat zij voor het derde achtereenvolgende jaar tot de top vijf van computerwetenschappenscholen van het land behoort. De ranglijst van de prestigieuze publicatie US News &amp; World Report houdt rekening met factoren zoals a